import React from 'react'
import './Carousel.css';
import Header from '../Header/Header';

const Slider = () => {
    return (<>
        <div className='blr-image'>
        <div className="bg-text" style={{ height: '100%', width: '100%' }}>
            <Header />
            <h1 align="center">Some header example</h1>
        </div>
        </div>
    </>
    )
}

export default Slider;
